import { useEffect, useState } from "react";
import axios from "axios";

interface UserDetails {
  name: string;
  address: string;
}

function RestaurantDetails({ userId }: { userId: string }) {
  const [userDetails, setUserDetails] = useState<UserDetails>({});

  useEffect(() => {
    axios
      .get(`https://challenge-8bmq.onrender.com/restaurants/${userId}`)
      .then((res) => {
        setUserDetails(res.data);
      });
  }, [userId]);

  console.log(userDetails);

  return (
    <main>
      <div className="card mt-4 me-1" style={{ width: "18rem" }}>
        <div className="card-body">
          <h5 className="card-title">Name: {userDetails?.name ?? "N/A"}</h5>
          <p className="card-text">
            Address: {userDetails?.address ?? "N/A"}
          </p>
        </div>
      </div>
    </main>
  );
}

export default RestaurantDetails;
